import React from 'react'
import './AutoWizard.css';

import {
    Row,
    Col
} from 'react-bootstrap';

import {
    Link
} from 'react-router-dom';

export default function WizardPopup() {
    return (
        <Row style={{height: window.innerHeight}} className="d-flex">
            
            <Row className="mx-auto">
                <p className="m-auto" className="auto-wizard-title">iModo Wizard</p>
            </Row>


        </Row>
    )
}
